import React from 'react';

import ExpenseItem from "./ExpenseItem";
import './Expenses.css'
import Card from "../UI/Card";

const Expenses=(props)=> {
  return (

    <Card className="expenses">
      {props.item.map((singleexpense)=> 
      <ExpenseItem title={singleexpense.title} amount={singleexpense.amount} date={singleexpense.date} ></ExpenseItem>)
      }


    </Card>
  );
}

export default Expenses;
